    if (!newBase) {
      newBase = ws.uri.split('#')[0];
    } else {
      newBase = newBase.value;
    }
    if (newBase.slice(-1) !== '/') {
      console.log(appPathSegment + ': No / at end of uriPrefix ' + newBase); // @@ paramater?
      newBase = newBase + '/';
    }
